import React from 'react';
import zIndex from '@material-ui/core/styles/zIndex';

let url = 'BG.jpg'
const ShowCase = () => {
    return (
        <div style={{
            backgroundColor: '#000000', 
            zIndex:'10',
            display: 'block'
            }}>
            <div style={{
                display: 'block',
                background: "url(" + require("./BG.jpg") + ") center",
                backgroundSize: 'cover',
                height: '50vh',
                zIndex: '-1'}}>
            </div>
        </div>
    )
}

export default ShowCase;
